( function() {
	  setTimeout(function(){
		if (jQuery("#primary").height()<jQuery("#secondary").height()) {
			jQuery("#primary").addClass('sticky_wrap');
			jQuery("#main").addClass('sticky_item');
			jQuery("#secondary").addClass('static_wrap');
		}else{
			jQuery("#secondary").addClass('sticky_wrap');
			jQuery("#secondary_inner").addClass('sticky_item');
			jQuery("#primary").addClass('static_wrap');
		}
		if (jQuery(".parallaxitem").length != 0) {
			var item = jQuery(".parallaxitem")[0];
			itemoffset = jQuery(item).offset(),
			itemheight = jQuery(item).height(),
			diff = itemoffset.top-itemheight;
			if(diff < jQuery("#secondary").height()) {
				//jQuery("#secondary").removeClass('sticky_wrap');
				//jQuery("#secondary_inner").removeClass('sticky_item');
				//jQuery("#primary").removeClass('static_wrap');
				//jQuery("#main").removeClass('sticky_item');
				jQuery(".sticky_wrap").height(jQuery(".static_wrap").height());
				
			}else{
				jQuery(".sticky_wrap").height(itemoffset.top-itemheight);
			}
		}else{
			jQuery(".sticky_wrap").height(jQuery(".static_wrap").height());
		}
		jQuery(".sticky_item").stick_in_parent({offset_top : 50});
	  },500);
})();
