( function() {



		  // 16. Sticky header
		jQuery(window).on('scroll', function() {
			sticky_header(jQuery(this));
			lastScrollTop = jQuery(this).scrollTop();	
		});

		jQuery(window).resize(function() {
			sticky_header(jQuery(this));
		});	
		var lastScrollTop = 0;
		function sticky_header(w) // Р”Р»СЏ Р·Р°РєСЂРµРїР»РµРЅРёСЏ С…РµРґРµСЂР°
		{
			var header = jQuery('.header_fixed');
			var pip1 = jQuery('.site-content').offset().top;
			switch(true){
				case (w.scrollTop() > pip1+100): 
					header.addClass('fixed');
					header.removeClass('pretop');
					break;
				case (w.scrollTop() < pip1+100 && w.scrollTop() > pip1):
					header.addClass('pretop');
					break;
				case (w.scrollTop() < pip1): 
					header.removeClass('fixed');
					header.removeClass('pretop');
					break;
			}

		}



})();

